class Hello {

	// Variables
	def log;
	def context;
	def testRunner;

     // Constructor mit 3 Parameters 
	def Hello (log, context, testRunner) {
		this.log = log;
		this.context = context;
		this.testRunner = testRunner;
	}

     // Methode
	def sayHello () {
          String str = "Hello world";
          log.info (str);
	}
	def sayHello (String name ) {
          String str = "Hello";
          log.info (str + " " + name);
	}
}

// Instanz von Klasse Hello erstellen
context.setProperty("Hello", new Hello(log, context, testRunner));

// schon in der klasse Hello erstellte Instanz abrufen
def testStep = testRunner.testCase.getTestStepByName("Hello");
testStep.run(testRunner, context);
// existierte Methode sayHello in der Klasse Hello abrufen
// ACHTUNG: der in der setProperty angegebene ParameterName muss hier beachtet
// werden (Bsp: angegebene ParameterName in setProperty war "Hello") 
context.Hello.sayHello();
context.Hello.sayHello("Valtere");

//Groovy - run request from another TestCase or TestSuite
// Pfad wo die existierte Request "GetCountryISOCode" vorhanden ist, muss beachtet werden
def project = testRunner.testCase.testSuite.project ;
def tcase = project.testSuites["TestSuite 3"].testCases["TestCase 1"] ; 
def tstep = tcase.getTestStepByName("GetCountryISOCode");
def status = tstep.run(testRunner, context);
def result = status.getStatus().toString();
log.info ("   ---- "+result)
if (result == "OK") {
 log.info (" Test Passed ! ");	
} else {
 log.info (" Test Failed ! ");	
}

//Groovy - run request from same TestCase
def status = testRunner.runTestStepByName("GetCountryISOCode")
def result = status.getStatus().toString();
log.info ("   ---- "+result)
if (result == "OK") {
 log.info (" Test Passed ! ");	
} else {
 log.info (" Test Failed ! ");	
}

